(select ( case when (obtenerlongitudtotal(cast(municipios.id as varchar)) <> 0) then (obtenerlongreddefict(cast(municipios.id as varchar))+obtenerlongestadomalo(cast(municipios.id as varchar)))*100/obtenerlongitudtotal(cast(municipios.id as varchar)) else 0 end )) *8+
