update queries set selectquery='SELECT "municipios"."GEOMETRY", "municipios"."id",
(select (case when (obtenerviviendas(cast(municipios.id as varchar)) <> 0) then obtenerpadron(cast(municipios.id as varchar))/obtenerviviendas(cast(municipios.id as varchar)) else 0 end )) as num_hab_viv,
(select obtenerplaneamiento(cast(municipios.id as varchar))) as planeam_urban,
(select (case when (obtenerpoblacionderecho(cast(municipios.id as varchar)) <> 0) then (obtenercapacidaddepo(cast(municipios.id as varchar))/obtenerpoblacionderecho(cast(municipios.id as varchar))*0.2) else 0 end )) as cap_reg_der,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <>0 ) then obtenercapacidaddepo(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar))*0.2 else 0 end )) as cap_reg_est,
(select (case when (obtenerpoblacionderecho(cast(municipios.id as varchar)) <> 0) then obtenersuperficiepav(cast(municipios.id as varchar))/obtenerpoblacionderecho(cast(municipios.id as varchar)) else 0 end )) as pob_def_der,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersuperficiepav(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as pob_def_est,
(select (case when (obtenerlongitudviarios(cast(municipios.id as varchar)) <> 0) then obtenernumpuntosluz(cast(municipios.id as varchar))*25/obtenerlongitudviarios(cast(municipios.id as varchar)) else 0 end )) as ind_puntos_luz,
(select obtenerpobsincentrosanit(cast(municipios.id as varchar))) as pob_def_der,
(select obtenerpobestsincentrosanit(cast(municipios.id as varchar))) as pob_def_est,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestcaudalins(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_capt,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestinsper(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_pot,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then 100 - 100*(obtenercapacidaddepo(cast(municipios.id as varchar))/(obtenerpoblacionestacional(cast(municipios.id as varchar))*200))/3 else 0 end )) as ind_dep,
(select ( case when (obtenerlongitudtotal(cast(municipios.id as varchar)) <> 0) then (obtenerlongreddefict(cast(municipios.id as varchar))+obtenerlongestadomalo(cast(municipios.id as varchar)))*100/obtenerlongitudtotal(cast(municipios.id as varchar)) else 0 end )) as ind_dist,
(select (case when (obtenerlongtotalsaneam(cast(municipios.id as varchar)) <> 0) then (obtenerlongdefsaneam(cast(municipios.id as varchar))+obtenerlongestadomalosaneam(cast(municipios.id as varchar)))*100/obtenerlongtotalsaneam(cast(municipios.id as varchar)) else 0 end )) as ind_saneam,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestsindep(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_depu,
(select (case when (obtenersupurbtotal(cast(municipios.id as varchar)) <> 0) then (obtenersupurbsinpav(cast(municipios.id as varchar)) + obtenersupurbestadomalo(cast(municipios.id as varchar)))/obtenersupurbtotal(cast(municipios.id as varchar)) else 0 end )) as id_pav,
(select (case when (obtenerlongitudviarios(cast(municipios.id as varchar)) <> 0) then 100 - 100*obtenernumpuntosluz(cast(municipios.id as varchar))*25/obtenerlongitudviarios(cast(municipios.id as varchar))/2 else 0 end )) as ind_alum,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestsinbas(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_bas,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestvert(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_res,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_cul,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubdepoestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_depo,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubverestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_ver,
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubadmestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) as ind_adm,

(((select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestcaudalins(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *14+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestinsper(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *10+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then 100 - 100*(obtenercapacidaddepo(cast(municipios.id as varchar))/(obtenerpoblacionestacional(cast(municipios.id as varchar))*200))/3 else 0 end )) *8+
(select ( case when (obtenerlongitudtotal(cast(municipios.id as varchar)) <> 0) then (obtenerlongreddefict(cast(municipios.id as varchar))+obtenerlongestadomalo(cast(municipios.id as varchar)))*100/obtenerlongitudtotal(cast(municipios.id as varchar)) else 0 end )) *8+
(select (case when (obtenerlongtotalsaneam(cast(municipios.id as varchar)) <> 0) then (obtenerlongdefsaneam(cast(municipios.id as varchar))+obtenerlongestadomalosaneam(cast(municipios.id as varchar)))*100/obtenerlongtotalsaneam(cast(municipios.id as varchar)) else 0 end )) *8+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestsindep(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *10+
(select (case when (obtenersupurbtotal(cast(municipios.id as varchar)) <> 0) then (obtenersupurbsinpav(cast(municipios.id as varchar)) + obtenersupurbestadomalo(cast(municipios.id as varchar)))/obtenersupurbtotal(cast(municipios.id as varchar)) else 0 end )) *6+
(select (case when (obtenerlongitudviarios(cast(municipios.id as varchar)) <> 0) then 100 - 100*obtenernumpuntosluz(cast(municipios.id as varchar))*25/obtenerlongitudviarios(cast(municipios.id as varchar))/2 else 0 end )) *6+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestsinbas(cast(municipios.id as varchar))*100/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *6+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenerpobestvert(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *6+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *6+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubdepoestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *6+
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubverestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *3 +--))/100 as ind_global
(select (case when (obtenerpoblacionestacional(cast(municipios.id as varchar)) <> 0) then obtenersupcubadmestadobr(cast(municipios.id as varchar))/obtenerpoblacionestacional(cast(municipios.id as varchar)) else 0 end )) *3))/100 as ind_global

